INSERT INTO `be_sql_management` VALUES ('03df8974ed86457fa0616aa03d692aed','created by BusinessFlowNode','queryDataRightForGrant方法的主业务流创建的SQL','select id value, data_right_name label\nfrom sys_data_right where \n((tenant_id = ? and right_ctl_type <> \'A\') or (? = \'Y\' and tenant_id = \'1\' and right_ctl_type = \'S\'))  and status=\'1\';','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2024-08-19 06:10:03','2024-08-19 08:30:43'),('588dca785ad34334a5baf0587ed1e8f3','created by BusinessFlowNode','queryRolesForGrand方法的主业务流创建的SQL','select id id, role_type roleType, role_name roleName, role_code roleCode, visible visible, description description, \nauto_assign autoAssign, right_ctl_type rightCtlType, status status, \ntenant_id tenantId, create_user createUser, create_time createTime, update_user updateUser, update_time updateTime \nfrom sys_role where \n(? is null or ? = \'\' or role_name like concat(\'%\', ?, \'%\')) and \n(? is null or ? = \'\' or role_type = ?) and (? is null or ? = \'\' or role_code like concat(\'%\', ?, \'%\')) and \n((tenant_id = ? and right_ctl_type <> \'A\')  or (? = \'Y\' and ? = \'1\' and right_ctl_type = \'A\') or (? = \'Y\' and tenant_id = \'1\' and right_ctl_type = \'S\')) \nand status=\'1\'','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2024-08-20 03:26:52','2025-03-19 09:33:31'),('5a40fc0c496a441eab6288192cc708c6','created by BusinessFlowNode','queryMenuRightV2方法的主业务流创建的SQL','(SELECT c.id id, c.right_type rightType, c.right_name rightName, c.parent_right_id parentRightId,\nc.url url, c.icon icon, c.display_order displayOrder, c.http_method httpMethod, c.right_ctl_type rightCtlType, c.status status, \nc.description description, c.tenant_id tenantId, c.create_user createUser, c.create_time createTime,\nc.update_user updateUser,c.update_time updateTime \nFROM sm.sys_user_role a, sm.sys_role_right b, sm.sys_right c WHERE a.user_id=? and a.role_id = b.role_id \nand b.right_id =c.id and c.right_type in (\'0\',\'1\'))\nunion \n(SELECT c.id id, c.right_type rightType, c.right_name rightName, c.parent_right_id parentRightId,\nc.url url, c.icon icon, c.display_order displayOrder, c.http_method httpMethod, c.right_ctl_type rightCtlType, c.status status, \nc.description description, c.tenant_id tenantId, c.create_user createUser, c.create_time createTime,\nc.update_user updateUser,c.update_time updateTime \nFROM sm.sys_user_right b, sm.sys_right c WHERE b.user_id=? \nand b.right_id =c.id and c.right_type in (\'0\',\'1\')) ORDER BY  displayOrder;','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2024-08-27 07:00:35','2024-08-27 07:33:10'),('a0daf098070b49aca15298b7a458c415','created by BusinessFlowNode','queryDataRight方法的主业务流创建的SQL','SELECT c.id dataRightId, c.data_right_code dataRightCode, c.data_right_name dataRightName, d.id dataRightValueId, d.data_right_value dataRightValue, d.description description from \nsys_user_role a, \nsys_role_data_right b left outer join sys_data_right_value d on b.data_right_value_id =d.id  JOIN  sys_data_right c  on b.data_right_id = c.id\nWHERE  a.user_id =? and a.role_id = b.role_id and c.status =\'1\'\nunion\nSELECT c.id dataRightId, c.data_right_code dataRightCode, c.data_right_name dataRightName, d.id dataRightValueId, d.data_right_value dataRightValue, d.description description  from \nsys_user_data_right  b left outer join sys_data_right_value d on b.data_right_value_id =d.id  JOIN  sys_data_right c  on b.data_right_id = c.id\nWHERE  b.user_id =? and c.status =\'1\'','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2023-05-04 02:30:48','2024-01-11 08:52:50'),('a86f0fbf51934f48ba49fe8131b4c7e4','created by BusinessFlowNode','loginFailedTimesProcess方法的主业务流创建的SQL','SELECT IFNULL(count(*),0)  failedNum FROM  sys_login_log WHERE user_id =? and login_time > DATE_SUB(NOW(), INTERVAL 3 minute) \nand login_time > (SELECT IFNULL(MAX(login_time),DATE_SUB(NOW(), INTERVAL 3 minute)) from sys_login_log WHERE user_id =? and login_result =\'1\' and login_time > DATE_SUB(NOW(), INTERVAL 3 minute) )','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2023-06-09 09:21:34','2023-06-09 09:36:46'),('b564bb58a5c2442a9d8383b1720ad4ad','created by BusinessFlowNode','queryMenuRight方法的主业务流创建的SQL','SELECT c.id id, c.right_type rightType, c.right_name rightName, c.parent_right_id parentRightId,\nc.url url, c.icon icon, c.display_order displayOrder, c.http_method httpMethod, c.right_ctl_type rightCtlType, c.status status, \nc.description description, c.tenant_id tenantId, c.create_user createUser, c.create_time createTime,\nc.update_user updateUser,c.update_time updateTime \nFROM sm.sys_user_right b, sm.sys_right c WHERE b.user_id=? \nand b.right_id =c.id and c.right_type in (\'0\',\'1\')\nORDER BY c.right_type, c.display_order','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2023-04-20 02:21:25','2024-08-16 08:58:11'),('b985a112f8b5404eb7bbcbbc307c2228','created by BusinessFlowNode','queryMenuRight方法的主业务流创建的SQL','SELECT c.id id, c.right_type rightType, c.right_name rightName, c.parent_right_id parentRightId,\nc.url url, c.icon icon, c.display_order displayOrder, c.http_method httpMethod, c.right_ctl_type rightCtlType, c.status status, \nc.description description, c.tenant_id tenantId, c.create_user createUser, c.create_time createTime,\nc.update_user updateUser,c.update_time updateTime \nFROM sm.sys_user_role a, sm.sys_role_right b, sm.sys_right c WHERE a.user_id=? and a.role_id = b.role_id \nand b.right_id =c.id and c.right_type in (\'0\',\'1\')\nORDER BY c.right_type, c.display_order','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2023-04-20 02:21:25','2024-08-16 08:58:11'),('dd6e20680ee14e91bb178b8bc2fcc6e4','created by BusinessFlowNode','queryRightForGrant方法的主业务流创建的SQL','select id id, right_type rightType, right_name rightName, parent_right_id parentRightId, url url, icon icon, display_order displayOrder, http_method httpMethod, right_ctl_type rightCtlType, status status, description description, tenant_id tenantId, create_user createUser, create_time createTime, update_user updateUser, update_time updateTime from sys_right where (? is null  or ?=\'\' or right_name like concat(\'%\', ?, \'%\')) and (? is null or ?=\'\' or right_type = ?) and ((tenant_id = ? and right_ctl_type <> \'A\') or (? = \'Y\' and tenant_id = \'1\' and right_ctl_type = \'S\')) and status=\'1\'','D','8502a5776feb4aa19595cba41ed1f314','1','62ad8860b6ae4307830bcbdcaaf778b6','2024-08-19 02:45:37','2024-08-19 08:31:20');
